import React from 'react';
import './App.css';
import { Login } from './components/login/index';

class App extends React.Component {
	constructor(props) {
		super(props);
		this.state = { isLoginActive: true };
	}
	render() {
		const { isLoginActive } = this.state;
		return (
			<div className='App'>
				<div className='login'>
					<div className='container'>{isLoginActive && <Login />}</div>
				</div>
			</div>
		);
	}
}

export default App;
